import React from "react";
import '../assets/css/CustomSelect.css';
import ArrowLeft from '../assets/icon/ArrowLeft';
import { getsearch } from '../utils/Help';
import onecallfun from "../utils/OneCallFun";
class CustomSelect extends React.Component {
  constructor(props){
    super(props);
    this.state={
      pickA:[0],
    };
  }
  goBackFun=()=>{
    this.props.history.goBack();
  }
  render() {
    const {location }=this.props;
    const searchA=getsearch(location);
    return (
      <div className="CustomSelectBox" onClick={()=>onecallfun(()=>{this.goBackFun();})}>
         <span>凑单金额：{searchA['price']}元</span><ArrowLeft width="15px" height="15px" fill="#888888"/>
      </div>
    );
  }
}

export default CustomSelect;
